					setcolor_outline		varchar(10),			#아웃라인색
					sethtml_shead		text,					#시작화면삽입HEADHTML
					sethtml_stail		text,					#시작화면삽입TAILHTML
					sethtml_rule		text,					#회원가입약관HTML
					setpos			varchar(6),				#툴정렬(왼쪽/가운데)
					setnum_list		tinyint(2),				#구인구직목록최대줄수	
					setnum_listmem		tinyint(2),				#회원관리최대줄수	
