#1광고(기획/홍보/영업/제작)
CREATE TABLE offer_main_advertise(
					seq 				int(11) DEFAULT '0' NOT NULL AUTO_INCREMENT,
					id_fk_offermem		varchar(20) NOT NULL,			
					name				varchar(10) NOT NULL,	#구인담당자이름
					email				varchar(40) NOT NULL,	#구인담당자메일주소
					tel				varchar(12) NOT NULL,	#구인담당자연락처
					work_kind			tinyint(1) 	 NOT NULL,	#근무형태 (0=정규직,1=비정규직,2=아르바이트)
					sex				tinyint(1)	 NOT NULL,	#구인성별구분 (0=구분없음 1=남자 2=여자)	
					educational_last		varchar(1)	 NOT NULL,	#학력제한 (0)중졸 (1)고졸  (2)대학졸(2년) (3)대학졸(4년) (4)대학원
					salary_year		tinyint(1),				#연봉
					salary_monthly		smallint(3),				#희망월급
					experience_year		tinyint(1),				#경력제한 무관(9) 신입(0) 경력(1)
					experience_for		tinyint(2),				#경력년수 경력자를 구하면서 경력년수제한이 있을때.
					age_limit			varchar(4),				#나이제한
					finishday			date,					#마감일
					finishday_no		tinyint(1),				#상시채용여부
					editdate			date,					#최근수정일
					title				tinytext	 NOT NULL,	#채용제목
					content			text		 NOT NULL,	#모집요강/내용
					work_class		varchar(16) NOT NULL,	#희망직종		#1#2#6# (5개까지)
					work_area			varchar(13) NOT NULL,	#근무할지역	#0#2# (4개까지가능) <-메인검색및맞춤정보에사용
					hit				int(8)		 DEFAULT '0',	#힛트수			
					PRIMARY KEY(seq)
						);

