INSERT INTO  jelse_setup_table VALUES ('black','A1BA95','DCDCC7','whitesmoke','DCDCC7','<table align=center border=1 cellspacing=0 width=800 bordercolordark=white bordercolorlight=#CCCCCC bordercolor=gray>\r\n    <tr>\r\n        <td width=783 valign=top height=155>\r\n            <p><font color=#5A8B5A><br></font><font color=#5894F0>&nbsp;[운영환경]</font><font color=#5A8B5A><br></font><br>&nbsp;<font color=#62626C>① 리눅스-PHP-MYSQL \r\n            / &nbsp;② \r\n            MYSQL-DB 1개</font><font color=#5A8B5A><br></font><font color=#62626C><br>&nbsp;② \r\n            위 운영환경은 대부분의 호스팅사에서 지원하는 인터넷 서버 환경입니다. \r\n            </font><br><br>','<br><br>\r\n&nbsp;<font color=#5894F0>[프로그램활용]</font><br><font color=#666600><br>&nbsp;구인구직사이트및 \r\n            지역포탈사이트, 지역신문사등에서 바로 사용할 수 있는 인터넷 구인구직프로그램 \r\n            입니다.<br><br>&nbsp;이 사이트는 새봄로(Sb-Road) 프로그램으로만 구성되어 \r\n            있으며 메인페이지/베너삽입/회원가입약관/꼬릿말등의 HTML은 환경설정에서 \r\n              <br> <br>&nbsp;쉽게 삽입할 수 있습니다.<br><br>&nbsp;백업/확장성/성능을 \r\n            최적화를 위한 데이타베이스(DB)를 세분화 하였으며 빠른검색/다양한 \r\n            조건검색을 지원합니다.<br><br>&nbsp;각 회원들이 등록한 글은 로그인 \r\n            후 각 회원만의 구인/구직등록글관리기능에서 삭제/수정/관리를 할 수 \r\n            있어 편리합니다.<br><br>&nbsp;구인/구직자 검색중에 입사희망/채용제의등의 \r\n            메시지를 메일과 함께 주고 받을 수 있습니다.<br><br>&nbsp;유료화에 \r\n            대비하기 위해 모든 등록글은 레벨/고유코드(구직등록글관리에출력)가 \r\n            주어지며 관리자에게 코드만 보내주면 관리자모드에서 \r\n            <br><br>&nbsp;해당등록글의 &nbsp;레벨(시작페이지출력/강조출력/HOT마크-강조출력)을 \r\n            조정할 수 있습니다.<br><br><br></font><font color=#5894F0>&nbsp;[기능소개]</font><font color=#666600><br></font><font color=#339933><br>&nbsp;① \r\n            효율적설계<br><br>&nbsp;② 편리한관리자모드(손님입장에서의 관리자모드)<br><br>&nbsp;③ \r\n            웹상환경설정모드(레아아웃/글자색/가입약관/초기화면등등의 손쉬운 \r\n            설정모드)<br><br>&nbsp;④ 회원별자기등록글관리도구(등록글관리/수정/삭제)<br><br>&nbsp;⑤ \r\n            체크기능(관심있는 구인/구직등록글 기억하기)<br><br>&nbsp;⑥ 초기화면(현재화면)에 \r\n            추천구인/구직글 보이기(다양한 옵션) <br><br>&nbsp;⑦ 초기화면(현재화면)에 \r\n            출력될구인/구직글관리도구<br><br>&nbsp;⑧ 구인/구직회원별 회원관리<br><br>&nbsp;⑨ \r\n            배너삽입(환경설정)<br><br>&nbsp;⑩ 구인회원전체메일<br><br>&nbsp;⑪ \r\n            구직회원전체메일<br><br>&nbsp;⑫유료화에 대비한 각 등록글의 코드생성 \r\n            및 등록코드를 사용한 레벨관리<br><br>&nbsp;⑬입사제의/채용제의 메세지보내기/확인/메세지관리<br><br><br></font></p>\r\n        </td>\r\n    </tr>\r\n</table>','<div align=center>\r\n<table border=0 cellpadding=0 cellspacing=0 width=800 bgcolor=white>\r\n<tr>\r\n<td bgcolor= white height=20>\r\n<p align=center><font color=black>관리자메뉴 -> 환경설정 -> 회원가입약관HTML에삽입</font>\r\n</td>\r\n</tr>\r\n</table>\r\n</div>','center',40,40,127,20,'<br><div align=center>\r\n<table border=0 cellpadding=0 cellspacing=1 width=800 bgcolor=green>\r\n<tr>\r\n<td bgcolor=whitesmoke width=800 height=15><p align=left>\r\n<p align=center><font color=gray>clock934@naver.com</font></td>\r\n</tr>\r\n</table>\r\n</div>\r\n<br><br>','<div align=center>\r\n<table border=0 cellpadding=0 cellspacing=0 width=600 bgcolor=white>\r\n<tr>\r\n<td bgcolor= white height=20>\r\n<p align=center><font color=black>관리자메뉴 -> 환경설정 -> 배너광고HTML\r\n에삽입</font>\r\n</td>\r\n</tr>\r\n</table>\r\n</div>','<div align=center>\r\n<table border=0 cellpadding=0 cellspacing=0 width=800 bgcolor=white>\r\n<tr>\r\n<td bgcolor= white height=20>\r\n<p align=center><font color=black>관리자메뉴 -> 환경설정 -> 상단HTML꾸미기에서 삽입</font>\r\n</td>\r\n</tr>\r\n</table>\r\n</div>');
